import React from "react";
import { Row, Col, Form } from "react-bootstrap";

function Contract() {
  return (
    <Row className="my-2">
      <Form>
        <Col sm={12} className="form-group mb-3">
          <label htmlFor="fullName" className="required">
            Job Title
          </label>
          <input
            type="text"
            placeholder="Enter your Contact Number"
            className="form-control form-control-sm"
            // className={nameClasses}
            // onChange={nameChangeHandler}
            // onBlur={nameBlurHandler}
            // value={enteredPhone}
          />

          {/* {nameInputHasError && (
                      <Form.Control.Feedback type="invalid">
                        Please fill in person-in-charge name.
                      </Form.Control.Feedback>
                    )} */}
        </Col>

        <Col sm={12} className="form-group mb-3">
          <label htmlFor="fullName" className="required">
            Salary -select box-
          </label>
          <input
            type="text"
            placeholder="Enter your Contact Number"
            className="form-control form-control-sm"
            // className={nameClasses}
            // onChange={nameChangeHandler}
            // onBlur={nameBlurHandler}
            // value={enteredPhone}
          />

          {/* {nameInputHasError && (
                      <Form.Control.Feedback type="invalid">
                        Please fill in person-in-charge name.
                      </Form.Control.Feedback>
                    )} */}
        </Col>

        <Col sm={12} className="form-group mb-3">
          <label htmlFor="fullName" className="required">
            Location
          </label>
          <input
            type="text"
            placeholder="Enter your Contact Number"
            className="form-control form-control-sm"
            // className={nameClasses}
            // onChange={nameChangeHandler}
            // onBlur={nameBlurHandler}
            // value={enteredPhone}
          />

          {/* {nameInputHasError && (
                      <Form.Control.Feedback type="invalid">
                        Please fill in person-in-charge name.
                      </Form.Control.Feedback>
                    )} */}
        </Col>

        <Col sm={12} className="form-group mb-3">
          <label htmlFor="fullName" className="required">
            Experience
          </label>
          <input
            type="num"
            placeholder="Enter your Contact Number"
            className="form-control form-control-sm"
            // className={nameClasses}
            // onChange={nameChangeHandler}
            // onBlur={nameBlurHandler}
            // value={enteredPhone}
          />

          {/* {nameInputHasError && (
                      <Form.Control.Feedback type="invalid">
                        Please fill in person-in-charge name.
                      </Form.Control.Feedback>
                    )} */}
        </Col>

        <Col sm={12} className="form-group mb-3">
          <label htmlFor="fullName" className="required">
            Education
          </label>
          <input
            type="text"
            placeholder="Enter your Contact Number"
            className="form-control form-control-sm"
            // className={nameClasses}
            // onChange={nameChangeHandler}
            // onBlur={nameBlurHandler}
            // value={enteredPhone}
          />

          {/* {nameInputHasError && (
                      <Form.Control.Feedback type="invalid">
                        Please fill in person-in-charge name.
                      </Form.Control.Feedback>
                    )} */}
        </Col>

        <Col sm={12} className="form-group mb-3">
          <label htmlFor="fullName" className="required">
            Field of Study
          </label>
          <input
            type="text"
            placeholder="Enter your Contact Number"
            className="form-control form-control-sm"
            // className={nameClasses}
            // onChange={nameChangeHandler}
            // onBlur={nameBlurHandler}
            // value={enteredPhone}
          />

          {/* {nameInputHasError && (
                      <Form.Control.Feedback type="invalid">
                        Please fill in person-in-charge name.
                      </Form.Control.Feedback>
                    )} */}
        </Col>

        <Col sm={12} className="form-group mb-3">
          <label htmlFor="fullName" className="required">
            Nationality
          </label>
          <input
            type="text"
            placeholder="Enter your Contact Number"
            className="form-control form-control-sm"
            // className={nameClasses}
            // onChange={nameChangeHandler}
            // onBlur={nameBlurHandler}
            // value={enteredPhone}
          />

          {/* {nameInputHasError && (
                      <Form.Control.Feedback type="invalid">
                        Please fill in person-in-charge name.
                      </Form.Control.Feedback>
                    )} */}
        </Col>

        <Col sm={12} className="form-group mb-3">
          <label htmlFor="fullName" className="required">
            Duration
          </label>
          <input
            type="num"
            placeholder="Enter your Contact Number"
            className="form-control form-control-sm"
            // className={nameClasses}
            // onChange={nameChangeHandler}
            // onBlur={nameBlurHandler}
            // value={enteredPhone}
          />

          {/* {nameInputHasError && (
                      <Form.Control.Feedback type="invalid">
                        Please fill in person-in-charge name.
                      </Form.Control.Feedback>
                    )} */}
        </Col>

        <Col sm={12} className="form-group mb-3">
          <label htmlFor="fullName" className="required">
            Start Date
          </label>
          <input
            type="date"
            placeholder="Enter your Contact Number"
            className="form-control form-control-sm"
            // className={nameClasses}
            // onChange={nameChangeHandler}
            // onBlur={nameBlurHandler}
            // value={enteredPhone}
          />

          {/* {nameInputHasError && (
                      <Form.Control.Feedback type="invalid">
                        Please fill in person-in-charge name.
                      </Form.Control.Feedback>
                    )} */}
        </Col>

        <Col sm={12} className="form-group mb-3">
          <label htmlFor="fullName" className="required">
            End Date
          </label>
          <input
            type="date"
            placeholder="Enter your Contact Number"
            className="form-control form-control-sm"
            // className={nameClasses}
            // onChange={nameChangeHandler}
            // onBlur={nameBlurHandler}
            // value={enteredPhone}
          />

          {/* {nameInputHasError && (
                      <Form.Control.Feedback type="invalid">
                        Please fill in person-in-charge name.
                      </Form.Control.Feedback>
                    )} */}
        </Col>

        <Col sm={12} className="form-group mb-3">
          <label htmlFor="fullName" className="required">
            Interview Option
          </label>
          <input
            type="text"
            placeholder="Enter your Contact Number"
            className="form-control form-control-sm"
            // className={nameClasses}
            // onChange={nameChangeHandler}
            // onBlur={nameBlurHandler}
            // value={enteredPhone}
          />

          {/* {nameInputHasError && (
                      <Form.Control.Feedback type="invalid">
                        Please fill in person-in-charge name.
                      </Form.Control.Feedback>
                    )} */}
        </Col>

        <Col sm={12} className="form-group mb-3">
          <label htmlFor="fullName" className="required">
            Job Requirement / Responsibility
          </label>
          <input
            type="text"
            placeholder="Enter your Contact Number"
            className="form-control form-control-sm"
            // className={nameClasses}
            // onChange={nameChangeHandler}
            // onBlur={nameBlurHandler}
            // value={enteredPhone}
          />

          {/* {nameInputHasError && (
                      <Form.Control.Feedback type="invalid">
                        Please fill in person-in-charge name.
                      </Form.Control.Feedback>
                    )} */}
        </Col>
      </Form>
    </Row>
  );
}

export default Contract;
